(6, 'language', 'english'),
(9, 'terms_conditions', ' <div class=\"container-lg terms-condition\">                <h1 class=\"\">Terms and Conditions</h1>                <p>Lusive (“Lusive” or “we” or “us” or “our”) has created a platform which brings artists and                    customers together. We provide a range of services, websites and mobile applications                    (collectively, the “Services”) which enable you to publish, sell, comment on, promote,                    and purchase artwork and art-related products through the Services and receive the                    benefits of the Services. The platform enables artists to earn money from their artwork                    by making it available for sale to customers.</p>                                    <p>Please carefully read these terms of service (“Terms”), our copyright and trademark                        policy (the “Copyright and Trademark Policy”), and our privacy policy (the “Privacy                        Policy”). Before you may use the Services, you must agree to these Terms and policies.                        By creating an account, publishing artwork, purchasing products, and otherwise using                        the Services, you agree to all of the terms and conditions in these Terms, the Copyright                        and Trademark Policy, as well as all other rules, policies and procedures relating to the                        Services that we may publish from time to time. If you are an artist or a customer who                        has signed up to receive notifications from us, you will receive a notice whenever we                        amend or update any of the rules, policies or procedures relating to the Services.</p>                        <h3>ARTWORK, CONTENT AND THIRD PARTY                            RIGHTS</h3>                           <h4> Artwork and Content License</h4><p>As between you and Lusive, you own all and retain all rights in your artwork andcontent. You hereby grant us, our websites, third party affiliates, wholesale partners,and our third party retailers a worldwide, royalty-free, nonexclusive, assignable license,with right of sublicense, to use, publicly display and publicly perform, publish,reproduce, modify, and distribute your artwork and content in any format or mediumnow known or later developed for the purpose of promoting your artwork and content,producing and promoting products with your artwork and content, and providing theServices.</p><p>Contact us if you do not wish to have your artwork displayed and sold on productsthrough our websites, third party affiliates, wholesale partners, or third party retailers.</p><p>YOU, AND NOT LUSIVE, ARE ENTIRELY RESPONSIBLE FOR ALL YOURARTWORK AND CONTENT THAT YOU MAKE AVAILABLE AND ALL PRODUCTSYOU OFFER FOR SALE THROUGH THE SERVICES, INCLUDING WITHOUTLIMITATION, THAT YOU OWN OR HAVE OBTAINED ALL REQUIREDINTELLECTUAL PROPERTY AND OTHER RIGHTS IN YOUR ARTWORK ANDCONTENT, INCLUDING WITHOUT LIMITATION, THE RIGHT TO MANUFACTURE,DISTRIBUTE AND SELL PRODUCTS THAT INCLUDE YOUR ARTWORK. Yourepresent and warrant that:</p><ol><li>you own all intellectual property rights in your artwork and content or that you    have obtained all copyrights, trademark rights, rights of publicity and other rights    required for you to make your artwork and content available through the    Services, to manufacture, distribute and sell products that include your artwork    and to grant us the rights granted to it in these Terms;</li>    <li>your artwork and content and the manufacture, distribution and sale of products        that include your artwork does not and will not infringe the intellectual property        rights or other rights of any person or entity, including without limitation any        copyright, moral rights, trademark, patent, right of publicity or right of privacy;</li>        <li>            your artwork and content do not contain material that is false, inaccurate,misleading, incomplete, defamatory or libelous obscene, pornographic, indecent,harassing, threatening, harmful, invasive of privacy, in violation of anyone’srights, including their privacy or publicity rights, abusive, inflammatory orotherwise objectionable;        </li>        <li>your artwork and content are accurate, not misleading or deceptive and do not            offer or disseminate fraudulent or counterfeit goods, products, services,            schemes, or promotions.</li></ol><p>You understand that the Services contain artwork and content submitted by artists that    may be in the form of designs, images, pictures, data, text, photographs, graphics,    video, messages, or other materials submitted, posted, published, displayed,    performed, or offered for sale through the Services.</p><h4>Linked Websites</h4>    <p><i>We are not responsible for websites linked to or from the Services.</i></p><p>The Services may contain links to other websites that are not owned or controlled by us.    Those links are provided for convenience only and may not remain current or be    maintained. We do not screen linked websites and are not responsible for the content,    security, operation, or use of any linked websites or the products or services that may    be offered or obtained through them. Our links to other websites should not be    construed as an endorsement, approval or recommendation by us of the owners or    operators of those linked websites, or of any information, graphics, materials, products    or services referred to or contained on those linked websites, unless and to the extent    we may explicitly stipulate to the contrary on the Services. Further, we are not    responsible for the content or privacy practices associated with linked websites, and it is    your responsibility to review those policies before accessing those websites. If you    access linked websites, you do so at your own risk.</p>    <h4>Copyright and Trademark Policy</h4>    <p><i>We are about empowering artists to create and providing those artists with a safe place        to sell their artwork. In order to achieve this, we only want original artwork uploaded to        our site. Uploading or copying someone else’s artwork, photographs, trademarks (logos,        characters, or names), is unethical, illegal, inexcusable and simply unacceptable.        Please respect our Copyright and Trademark Policy and respect other artists’        intellectual property.</i></p><p>You agree to abide by our Copyright and Trademark Policy, which is incorporated    herein by reference, including the procedures to report infringements of copyrights,    trademarks, or other intellectual property rights.</p>    <p>IT IS YOUR RESPONSIBILITY TO MAKE SURE THAT YOU ARE UPHOLDING YOUR        LEGAL RESPONSIBILITIES AND NOT VIOLATING ANYONE’S RIGHTS OR        BREAKING ANY LAWS BY PUBLISHING OR OFFERING ARTWORK FOR SALE        THROUGH THE SERVICES.</p>        <p>It is our policy, in appropriate circumstances and in our sole discretion, to (i) remove            individual artworks, tags, titles, or descriptions and; (ii) disable and/or terminate the            accounts of artists who infringe the copyrights, trademarks, or other intellectual property            rights of others. In addition to all other remedies available to us, we will not pay you any            Artist Share if you are found to be in violation of our Copyright and Trademark Policy.</p>            <h3>BUYING AND SELLING PRODUCTS</h3>            <p><i>If you buy something, we kindly require you to pay for it. In order to send these items to                you, we will ask for some personal payment and shipping information—we have to                because you’re going to want the thing you just bought, right? In rare cases, something                may not be available and we will inform you of that promptly.</i></p>                <h4>Orders</h4><p>All products are subject to availability and we reserve the right to impose quantity limits    on any order, to reject all or part of an order, and to discontinue products without notice,    even if you have already placed your order. Your placement of an order as a customer    does not necessarily assure that we will accept your order. We reserve the right to    refuse any order in our sole discretion. In addition, before accepting your order, we may        require additional information if you have not provided all the information required by us    to complete your order.</p>    <h4>Payments</h4>    <p>If products or services are made available for purchase through the Services and you        wish to purchase the products or services, you may be asked by us or our designee (or,        if the products or services are being made available by a third party provider, by the        third party provider) to supply certain information relevant to your purchase, including,        without limitation, credit card number, expiration date, billing address and shipping        information.</p>        <p>YOU REPRESENT AND WARRANT THAT YOU HAVE THE LEGAL RIGHT TO USE            ANY CREDIT CARD(S) OR OTHER PAYMENT MEANS USED BY YOU OR            THROUGH YOUR ACCOUNT TO PURCHASE ANY PRODUCT AND/OR SERVICE.</p>            <p>You acknowledge that any such information will be treated by us in accordance with our                Privacy Policy. You grant us the right to provide such information to third parties in order                to facilitate the completion of transactions initiated by you or on your behalf through the                Services. Verification of information may be required prior to acceptance of any order                through the Services.</p>                <h4>Taxes and Shipping</h4><p>Applicable taxes will be shown during the checkout process prior to finalizing your order.    If applicable, VAT is included in the purchase price. Shipping charges will be shown    during the checkout process prior to finalizing your order. Shipping charges include the    rate we are charged by third parties for sending your order, plus a reasonable amount    for packaging and handling. Title to products passes to you upon shipment. We    endeavor to deliver all orders on-schedule. However, we cannot guarantee that our    shipping providers or suppliers will not experience any shipping delays or problems.</p>    <h4>Errors, Inaccuracies and Omissions</h4>    <p><i>On rare occasions, you might find that the product you receive does not match what you        saw online. If that occurs, let us know.</i></p>        <p>We strive to be as accurate as possible. However, we do not warrant that all product            descriptions, images, photographs, pricing or other information on the Services are            accurate, complete, current, or error-free. In addition, all weights and size dimensions            are approximate. If a product offered by us is not as described or pictured, your sole            remedy is to return it in an unused condition for a refund in accordance with our Return,            Exchange and Refund policies below. In the event of an error, whether on the Services,            in an order confirmation, in processing an order, in delivering a product or otherwise, we            reserve the right to correct any error and revise your order accordingly, or to cancel the            order and refund any amount charged. IF YOU RECEIVE AN ORDER THAT YOU            BELIEVE CONTAINS A MISTAKE, WE ENCOURAGE YOU TO CONTACT US RIGHT            AWAY SO THAT WE MAY CORRECT THE ERROR.</p>            <h4>Return, Exchange and Refund Policies</h4>            <p>As much as we’d like to, we can’t always guarantee your happiness with a product. To                address this, we have a return policy.</p>                <ul>                    <li>Return and refund requests must be submitted within 3 days of                        the delivery date.</li>                        <li>                            Shipping & Handling fees paid on the original purchase are non-refundable.                        </li>                        <li>Customers are responsible for return costs.</li>                </ul>                        <h4>Artist Share</h4>                        <p><i>We give the artists their fair share of profit made by products sold by them. However, ifyou violate these Terms or any of our policies, and your account is suspended, you willnot receive any pending payments.</i></p><p>IN THE EVENT THAT YOUR ACCOUNT IS SUSPENDED OR TERMINATED DUE TOYOUR VIOLATION OF THESE TERMS OR OUR POLICIES AS DETERMINED BY USIN OUR REASONABLE DISCRETION, YOU WILL NOT BE ELIGIBLE TO RECEIVEANY UNPAID ARTIST SHARE. IN ADDITION, WE WILL HAVE THE RIGHT TOREQUIRE REIMBURSEMENT OF ANY ARTIST SHARE PAID TO YOU WHILE YOUWERE IN BREACH OF THESE TERMS OR OUR POLICIES.</p><h4>ACCOUNTS</h4><p><i>You can’t sell artwork on the Services without having an account. Please provide uswith required information accurately and responsibly.You are solely responsible for all the activity that occurs through your account, includingthe activities of others and regardless of whether the activities are authorized, and forkeeping your account password secure. You agree to notify us immediately of anybreach of security or unauthorized use of your account. Although we will not be liable foryour losses caused by any unauthorized use of your account, you may be liable for ourlosses or the losses of others due to any unauthorized use. We reserve the right torequire you to alter your password if we have reason to believe your password is nolonger secure. We may also require you to change your password from time to time.<br>You may not select a user name that is vulgar, offensive, obscene or attempts toimpersonate another person. You may never use another person’s account. We reservethe right to refuse to provide you with an account or cancel your account in our solediscretion, provided that such termination will not terminate our obligation to make anypayments to you that may be owed.</i></p><h5>    <i>Termination of Account</i></h5><ol>    <li>We may suspend or terminate your access to the Services if you are determined        to be, in our sole discretion, in violation of these Terms or any of our policies. We        may also suspend or terminate your access to all or any part of the Services or        your account at any time, with or without cause, with or without notice, effective        immediately.</li>        <li>You may terminate these Terms at any time by terminating your use of the            Services.</li>            <li>On termination of these Terms for any reason, the rights and licenses granted to                you hereunder will immediately terminate and the provisions of these Terms that                by their nature and context are intended to survive termination will survive. We                will have no liability to you for any damages, loss of profits or other claims arising                from the termination or suspension of your access to the Services or your                account.</li></ol>                                <p>Upon termination we will suspend your account and remove your artwork, if any, from                    the Services within thirty (30) days. Without limitation of the foregoing, we will have the                    right to retain copies of your account information, artwork and content in our archives for                    our internal business and legal purposes. Unless your account has been terminated for                    a breach of these Terms or any of our policies, as determined by us in our reasonable                    discretion, you will be paid, in the ordinary course, any Artist Share owed to you through                    the termination of your account.                <br>                You agree to abide by these Terms and our policies while using the Services and                interacting with other users. Lusive is founded on respect for others, and we take this                extremely seriously. You agree that you will not, either directly or indirectly:</p>                <ol>                    <li>Transfer your account or account information to another party without our prior                        written consent;</li>                        <li>                            Create deceptive accounts or more than one (1) account without our prior writtenapproval;                        </li>                        <li>                            Post artwork, titles, tags, descriptions, or other content that is pornographic,obscene, offensive, profane, or depicts, promotes, or incites illegal activity, hate,abuse, discrimination, denigration, objectification, or violence, or otherwiseviolates our community standards.                        </li>                        <li>                            Use, reproduce, copy, modify, adapt, create derivative works from, publish, print,transmit, distribute, perform, display, sell, license, rebrand, or otherwise transfer:(a) any portion of the Services, artwork or content made available through theServices other than your own artwork or content, without the owner’s expresswritten permission; or (b) any Lusive copyrights or trademarks;                        </li>                        <li>Frame, mirror, or otherwise simulate the appearance or function of the Services                            or any other user’s artwork or content or forge headers, icons or otherwise                            manipulate identifiers in order to disguise the origin of any artwork or content                            transmitted through the Services;</li>                            <li>Decompile, disassemble or otherwise reverse engineer the Services or any                                portion thereof, or otherwise attempt to derive the source code or other trade                                secrets embodied in the Services;</li>                                <li>Interfere with another user’s artwork or content;</li>                                <li>Remove any copyright, trademark or other proprietary rights notices contained in                                    or on the Services or any artwork or content other than your own artwork or                                    content;</li>                                    <li>Upload, post, email, transmit or otherwise make available any artwork or content                                        that you do not have a right to make available under any law or under contractual                                        or fiduciary relationships (such as inside information or other proprietary and                                        confidential information learned or disclosed as part of employment relationships                                        or under nondisclosure agreements);</li>                                        <li>Post artwork, content, titles, tags, or descriptions that infringe on a third party’s                                            copyright, trademark, right of publicity, or other intellectual property rights. Please                                            see our Copyright and Trademark Policy section for further details.</li>                                            <li>Post artwork or content with inaccurate, deceptive, inappropriate, or offensive                                                titles, tags, or descriptions;</li>                                                <li>Stalk, harass or harm another person via use of the Services;</li>                                                <li>Impersonate any person or entity, including, but not limited to, our employees,                                                    representatives or users, or falsely state or otherwise misrepresent your affiliation                                                    with a person or entity;</li>                                                 