BITRATE IS VOID OR    VOIDABLE.<br><br>        TO THE FULLEST EXTENT PERMITTED BY APPLICABLE LAW, YOU HEREBY    WAIVE ANY LEGAL OR EQUITABLE RIGHTS OR REMEDIES YOU HAVE OR MAY    HAVE AGAINST US WITH RESPECT TO ANY ACTIVITIES, ARTWORK, CONTENT,    ACTIONS OR INACTIONS OF ANY THIRD PARTY IN CONNECTION WITH THE    SERVICES, INCLUDING WITHOUT LIMITATION, ANY ILLEGAL, DEFAMATORY,    OFFENSIVE, OR UNAUTHORIZED CONDUCT BY ANY USERS.<br><br>    THE SERVICES ARE PROVIDED “AS IS”, “AS AVAILABLE”, AND WITH ALL FAULTS.    WE CANNOT GUARANTEE CONTINUOUS OR SECURE ACCESS TO OR THAT THE    SERVICES WILL BE ERROR FREE OR THAT ALL TRANSACTIONS WILL BE    COMPLETED. THE OPERATION OF THE SERVICES MAY BE INTERFERED WITH    BY NUMEROUS FACTORS OUTSIDE OF OUR CONTROL. TO THE EXTENT    LEGALLY PERMITTED, WE DISCLAIM ALL EXPRESS AND IMPLIED WARRANTIES,    TERMS AND CONDITIONS, INCLUDING, BUT NOT LIMITED TO ANY IMPLIED    WARRANTIES OF MERCHANTABILITY, QUALITY OF INFORMATION, QUIET    ENJOYMENT, NONINFRINGEMENT, TITLE, OR FITNESS FOR A PARTICULAR    PURPOSE. YOU ASSUME ALL RISKS ASSOCIATED WITH YOUR USE OF THE    SERVICES.</i></p><h4>Limitation of Liability</h4><p>TO THE FULLEST EXTENT PERMITTED BY APPLICABLE LAW, WE ARE NOT AND    WILL NOT BE LIABLE FOR INDIRECT, SPECIAL, PUNITIVE, EXEMPLARY,    CONSEQUENTIAL, OR ANY OTHER DAMAGES WHATSOEVER, INCLUDING, BUT    NOT LIMITED TO, ANY LOSS OF MONEY OR PROFITS, GOODWILL, DATA,    ARTWORK, CONTENT OR REPUTATION, OR ANY PROPERTY DAMAGE OR    PERSONAL INJURY WITHOUT REGARD TO THE FORM OF ACTION (INCLUDING,    BUT NOT LIMITED TO, CONTRACT, NEGLIGENCE, OR OTHER TORTIOUS    ACTIONS) ARISING OUT OF OR IN CONNECTION WITH YOUR USE OF THE    SERVICES, EVEN IF WE HAVE BEEN ADVISED OF THE POSSIBILITY OF THOSE    DAMAGES. YOU WAIVE ANY AND ALL CLAIMS, NOW KNOWN OR LATER    DISCOVERED, THAT YOU MAY HAVE AGAINST US ARISING OUT OF YOUR USE    OF THE SERVICES.<br><br>    REGARDLESS OF THE PREVIOUS PARAGRAPH, IF WE ARE FOUND TO BE    LIABLE, OUR LIABILITY TO YOU