(47, 'privacy_policy', '<p></p><p></p><p><span xss=removed>We know that you care how information about you is used and shared, and we appreciate your trust</span></p><span xss=removed>that we will do so carefully and sensibly. We are committed to recognizing and respecting your\r\nprivacy rights by keeping you informed and processing and protecting your personal data in\r\ncompliance with applicable data protection laws and regulations (\" Data Protection Laws\").This\r\nPrivacy Notice describes how Lusiveksa.com and its affiliates collect and process your personal\r\ninformation through Lusive website,products, services, online stores, and applications that reference\r\nthis Privacy Notice. </span><span xss=removed>By using Lusive services, you are consenting to the practices described in</span><p></p><span xss=removed>this Privacy Notice.</span><p></p><p></p><h3>What Personal Information About Customers Does\r\nLusive Collect?</h3><h4> Artwork and Content License</h4><p>We collect your personal information in order to provide and continually improve our\r\nproducts and services.</p><p><span xss=removed>Here are the types of personal information we collect:</span></p><p></p><ul><li><span xss=removed>Information You Give Us: We receive and store any information you provide in\r\nrelation to Lusive Services.</span></li><li><span xss=removed>Automatic Information: We automatically collect and store certain types of\r\ninformation about your use of Lusive application, including information about\r\nyour interaction with content and services available through Lusive application.\r\nLike many websites, we use \"cookies\" and other unique identifiers, and we obtain\r\ncertain types of information when your web browser or device accesses Lusive\r\nproducts.<br></span></li></ul><h3>For What Purposes Does Lusive Use Your Personal</h3><h3>Information?</h3><h3><span xss=removed>We use your personal information to operate, provide, develop, and improve the products</span><br></h3><p><span xss=removed>and services that we offer our customers. These purposes include:</span></p><p><span xss=removed><br><ul><li>Purchase and delivery of products and services. We use your personal\r\ninformation to take and handle orders, deliver products and services, process\r\npayments, and communicate with you about orders, products and services, and\r\npromotional offers.</li><li>Provide, troubleshoot, and improve Lusive application and services. We use your\r\npersonal information to provide functionality, analyze performance, fix errors, and\r\nimprove the usability and effectiveness of Lusive application.</li><li>Recommendations and personalization. We use your personal information to\r\nrecommend features and products that might be of interest to you, identify your\r\npreferences, and personalize your experience with Lusive.</li><li>Comply with legal obligations. In certain cases, we collect and use your personal\r\ninformation to comply with laws. For instance, we collect from sellers information\r\nregarding place of establishment and bank account information for identity\r\nverification and other purposes.</li><li>Communicate with you. We use your personal information to communicate with\r\nyou in relation to Lusive via different channels (e.g., by phone, email, chat).</li><li>Advertising. We use your personal information to display interest-based ads for\r\nfeatures, products, and services that might be of interest to you. We do not use\r\ninformation that personally identifies you to display interest-based ads.</li><li>Fraud Prevention and Credit Risks. We use personal information to prevent and\r\ndetect fraud and abuse in order to protect the security of our customers, Lusive,\r\nand others. We may also use scoring methods to assess and manage credit risks.<br></li></ul></span><br></p><p></p>'),
